import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom'; 

  function LoginPage() {
    const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate(); // Change from useHistory to useNavigate
  console.log(email);
  const login = () => {
    // Your login logic here
    const isValid = false; // Set your condition for validity

    if (isValid) {
      // Navigate to "/about" if the condition is satisfied
      navigate('/about');
    }
  };

    return (
    <div className='login'>
      <link href='https://unpkg.com/boxicons@2.1.4/css/boxicons.min.css' rel='stylesheet'></link>
        <section>
          <form >
            <h1>Login</h1>
            <div className="input-box">
              <input type="text" name="email" id="email" placeholder='Email' required />&nbsp;
              <i class='bx bxs-envelope'></i>
            </div>
            <div className="input-box">
              <input type="password" name="password" id="password" placeholder='Password' required />&nbsp;
              <i className='bx bxs-lock-alt'></i>
            </div>
  {/*           
            <div className="ForgotPass">
              <Link itemProp="url" to="/signup">Forgot Password?</Link>
            </div> */}
            <Link itemProp="url" to="/about">
            <button id="login" onclick="login()" type="submit" class="btn">Login</button>
          </Link>
            
            <div className="createacc">
              Don't have an account?&nbsp;
              <Link itemProp="url" to="/signup">Register Here</Link>
            </div>
          </form>
        </section>
        
      </div>
      
    );
  }

  export default LoginPage;
